('in', '_template', 'chat_help_display_blurb', '<p>Catatan: <em>Loncat ke</em> link dan <em>kunci cepat</em> daftar hanya muncul jika anda mengaktifkannya <em>Navigasi Aids</em> pada preferensi anda.\r\n\r\n<ul>\r\n<li> <em>Loncat ke kunci cepat</em> link di atas memberi tahu anda daftar untuk cara cepat menggunakan chat. </li>\r\n<li> <em>Area pesan</em> perliahatkan pesan yang lalu (di atas 10). </li>\r\n<li> <em>Loncat ke pesan</em> link menghantarkan anda ke awal dari daftar pesan. (Alt+M) </li>\r\n<li> <em>Refresh pesan</em> link menghantarkan anda untuk mengecek pesan baru (Alt+R). </li>\r\n<li> <em>tulis pesan </em> Field dan <em>tombol kirim</em> memudahkan anda masuk dan menulis surat (Alt+C untuk masuk area tulis pesan, Enter untuk mengirim surat yang lengkap). </li>\r\n</ul>', '2009-02-26 08:15:00', ''),
